import Link from "next/link";

const Index = () => {
  return (
    <div>
      <div>
        <Link>
          <a href="/">Head</a>
        </Link>
        <Link>
          <a href="/users">Users</a>
        </Link>
      </div>
      <h1>Head page</h1>
    </div>
  );
};

export default Index;
